<template>
  <v-app>
    <v-card class="pt-1" elevation="0">
      <h2 class="text-center bg-color py-12">Panel administrativo</h2>
      <div class="line"></div>
    </v-card>
    <v-row class="container-channel">
      <v-col cols="12" class="mt-0 pt-0">
        <v-container>
          <v-row justify="start">
            <v-col
              cols="12"
              xs="6"
              sm="6"
              md="6"
              lg="6"
              xl="12"
              class="py-0 text-start"
            >
              <h2 class="">Descargar reportes</h2>
            </v-col>
          </v-row>
          <v-row>
            <v-col cols="12" v-for="(item, index) in array_lista" :key="index">
              <v-card height="70" elevation="2">
                <v-container class="fill-height px-14">
                  <h4>{{ item.text }}</h4>
                  <v-spacer></v-spacer>
                  <v-tooltip bottom color="info">
                    <template v-slot:activator="{ on, attrs }">
                      <v-btn
                        v-bind="attrs"
                        v-on="on"
                        fab
                        dark
                        small
                        color="green"
                        rounded
                        class="botone"
                        @click="preguntarImpresion(item.id)"
                      >
                        <v-icon>mdi-microsoft-excel</v-icon>
                      </v-btn>
                    </template>
                    <span>Descargar formato XLSX</span>
                  </v-tooltip>
                  <v-btn
                    fab
                    dark
                    small
                    rounded
                    color="info"
                    class="ml-2 botone"
                    v-if="item.auditor"
                    @click="verTabla(item)"
                  >
                    <v-icon>mdi-account-search</v-icon>
                  </v-btn>
                </v-container>
              </v-card>
            </v-col>
          </v-row>
        </v-container>
      </v-col>

      <Alerta_ :alert="alert_" v-if="alert_.estado" />
    </v-row>
    <TablaVotosCategoria
      :voto_categoria="voto_categoria"
      v-if="voto_categoria.estado"
    />
    <TablaVotosPostulacion
      :voto_postulacion="voto_postulacion"
      v-if="voto_postulacion.estado"
    />
    <TablaResultados
      :resultado_votaciones="resultado_votaciones"
      v-if="resultado_votaciones.estado"
    />
  </v-app>
</template>

<script>
import {
  reporteVotos,
  reporteVotosPostulacion,
  reporteComite,
} from "../../excel/index";
import TablaVotosPostulacion from "../../components/auditor/TablaVotosPostulacion.vue";
import TablaVotosCategoria from "../../components/auditor/TablaVotosCategoria.vue";
import TablaResultados from "../../components/auditor/TablaResultados.vue";
import { INPUT, AUTOCOMPLETE } from "@/mixins/global";
import { ALERTA } from "../../mixins/alerta";
import { CURRTET_USER } from "../../global";
import { generarImpresion } from "@/print";
import { Components } from "@/mixins";
import { mapActions } from "vuex";
import moment from "moment";

export default {
  mixins: [INPUT, AUTOCOMPLETE, ALERTA, Components],
  components: { TablaVotosCategoria, TablaVotosPostulacion, TablaResultados },

  data() {
    return {
      usuario: CURRTET_USER,
      estado: false,
      voto_categoria: {
        estado: false,
        categorias: [],
      },
      logo: "data:image/png;base64,",
      voto_postulacion: {
        estado: false,
        categorias: [],
      },
      resultado_votaciones: {
        estado: false,
        votaciones: [],
      },
      array_lista: [
        {
          text: "Todos los canales",
          id: 1,
          email: "jhonbra@gmail.com",
        },
        {
          text: "Todas las postulaciones",
          id: 2,
          email: "jhonbra@gmail.com",
        },
        {
          text: "Canales por pagar",
          email: ["jhonbra@gmail.com", "pastusito_14@hotmail.com"],
          id: 3,
        },
        {
          text: "Estado de votaciones",
          auditor: true,
          id: 6,
        },
        {
          email: "jhonbra@gmail.com",
          text: "Miembros acreditados de la industria",
          id: 8,
        },
        {
          email: "jhonbra@gmail.com",
          text: "Resultado de votaciones",
          id: 9,
        },
        {
          text: "Estado de miembros votantes",
          id: 10,
        },
      ],
      array_usuarios: [],
      array_postulaciones: [],
    };
  },
  watch: {},
  mounted() {
    if (this.usuario.email == "jhonbra@gmail.com") {
      this.array_lista = this.array_lista.filter(
        ({ email }) => this.usuario.email == email
      );
    }
  },
  methods: {
    ...mapActions({
      _consultVotacionMiembrosVotantes:
        "admin/_consultVotacionMiembrosVotantes",
      _consultResultadoVotosV2: "admin/_consultResultadoVotosV2",
      _consultResultadoVotos: "admin/_consultResultadoVotos",
      _getPostulaciones: "postulacion/_getPostulaciones",
      _getMiembroVotantes: "admin/_getMiembroVotantes",
      _getCanales: "canales/_getCanales",
      _reportVoter: "admin/_reportVoter",
      _getPagos: "postulacion/_getPagos",
      _getConteos: "admin/_getConteos",
    }),
    preguntarImpresion(item) {
      this.callAlerta(
        "xlsx_",
        "info",
        "p",
        () => this.seleccionarImpresion(item),
        this.ALTD_
      );
    },
    seleccionarImpresion(item) {
      switch (item) {
        case 1: //canales
          this.cargarUSuarios();
          break;
        case 2:
          this.cargarPostulacione();
          break;
        case 3:
          this.cargarUSuariosNoPago();
          break;
        case 4:
          this.cargarConteos(4);
          break;
        case 5:
          this.cargarConteos(5);
          break;
        case 6:
          this.cargarEstadoVotacion(6);
          break;
        case 7:
          // this.cargarEstadoVotacion();
          break;
        case 8:
          this.cargarVotacionMiembrosVotantes();
          break;
        case 9:
          this.cargarResultadoVotaciones();
          break;
        case 10:
          // this.cargarEstadoMiembros();
          this.reportVoter();
          break;
      }
    },
    async verTabla({ id }) {
      if (id != 6) returns;
      try {
        const response = await this._consultResultadoVotos();
        this.resultado_votaciones.estado = true;
        this.resultado_votaciones.votaciones = response;
      } catch (error) {
        this.resultado_votaciones.estado = false;
        this.resultado_votaciones.votaciones = [];
        this.callAlerta("?", "info", error, this.ALTD_, this.ALTD_);
      }
      // await this.cargarVotos(item.id);
    },
    async cargarUSuarios() {
      this.array_usuarios = [];

      const RES = await this._getCanales();

      let columnas = [
        { title: "Nombre", value: "nameClient" },
        { title: "Email", value: "email" },
        { title: "Email 2", value: "emailTwo" },
        { title: "Telefono", value: "phone" },
        { title: "Celular", value: "celphone" },
        { title: "Contacto", value: "contact" },
        { title: "Ciudad", value: "city" },
        { title: "Direccin", value: "adress" },
      ];
      let header = [
        { text: "PREMIOS INDIA CATALINA 2025", bold: true, size: 16 },
        `IMPRESION INFORME DE CANALES`,
        `Fecha de impresin ${moment().format("YYYY-MM-DD")}`,
        ` `,
      ];
      if (RES.data?.data) {
        this.array_usuarios = RES.data.data.map((e) => e.channel);
        generarImpresion({
          header,
          logo: this.logo,
          tabla: { columnas, data: this.array_usuarios },
        });
      }
    },
    async cargarPostulacione() {
      const RES = await this._getPostulaciones();

      let columnas = [
        { title: "Nombre", value: "name" },
        { title: "Email", value: "email" },
        { title: "Telefono", value: "phone" },
        { title: "Celular", value: "celphone" },
        { title: "Foto", value: "photo" },
        { title: "Video", value: "video" },
        { title: "Categoria", value: "nameCategory" },
        { title: "Canal", value: "nameClient" },
      ];
      let header = [
        { text: "PREMIOS INDIA CATALINA 2025", bold: true, size: 16 },
        `IMPRESION INFORME DE POSTULACIONES`,
        `Fecha de impresin ${moment().format("YYYY-MM-DD")}`,
        ` `,
      ];
      if (RES.data?.data) {
        this.array_postulaciones = RES.data.data.map((e) => {
          return {
            name: e.name,
            email: e.email,
            phone: e.phone,
            celphone: e.celphone,
            photo: e.photo,
            video: e.video,
            nameCategory: e.category?.nameCategory,
            nameClient: e.channel?.nameClient,
          };
        });
        generarImpresion({
          header,
          logo: this.logo,
          tabla: { columnas, data: this.array_postulaciones },
        });
        // reportePostulaciones(this.array_postulaciones);
      }
    },
    async cargarVotos(item) {
      const RES = await this._getConteos();

      if (RES.data?.data.length) {
        this.array_postulaciones = RES.data.data;
        if (item == 4) {
          this.voto_categoria.estado = true;
          this.voto_categoria.categorias = this.array_postulaciones;
        } else if (item == 5) {
          let new_array = this.array_postulaciones.map((e) =>
            e.postulations.map((u) => ({
              nombre: u.name,
              categoria: e.nameCategory,
              votos: u.votes,
              programa: u.nameProgram,
              canal: u.channel.nameClient,
              porcentaje: u.vrPorcentualPost,
            }))
          );
          let news = [];
          new_array.forEach((e, i) => {
            e.forEach((i) => {
              news.push(i);
            });
          });
          this.voto_postulacion.estado = true;
          this.voto_postulacion.postulaciones = news;
        }
      }
    },
    async cargarConteos(item) {
      const RES = await this._getConteos();
      if (RES.data?.data.length) {
        this.array_postulaciones = RES.data.data;
        if (item == 4) {
          reporteVotos(this.array_postulaciones);
        } else if (item == 5) {
          let new_array = this.array_postulaciones.map((e) =>
            e.postulations.map((u) => ({
              nombre: u.name,
              categoria: e.nameCategory,
              canal: u.channel.nameClient,
              programa: u.nameProgram,
              votos: u.votes,
              porcentaje: u.vrPorcentualPost,
            }))
          );
          let news = [];
          new_array.forEach((e, i) => {
            e.forEach((i) => {
              news.push(i);
            });
          });
          reporteVotosPostulacion(news);
        } else if (item == 6) {
          let new_array = this.array_postulaciones.map((e) =>
            e.postulations.map((u) => ({
              general: {
                postulationsCount: e.postulationsCount,
                porcentaje: e.vrPorcentual,
                categoria: e.nameCategory,
                totalVotes: e.totalVotes,
                nominados: e.nominados,
                nmct: e.nmct,
                pmct: e.pmct,
                npc: e.npc,
                vr: e.vr,
              },
              datos: {
                porcentaje_postulacion: u.vrPorcentualPost,
                nombre: u.name,
                votos: u.votes,
              },
              comite: u.voteList,
            }))
          );
          let news = [];
          new_array.forEach((e, i) => {
            e.forEach((i) => {
              news.push(i);
            });
          });

          reporteComite(news);
        }
      }
    },
    async cargarUSuariosNoPago() {
      this.array_usuarios = [];
      const RES = await this._getPagos();
      let columnas = [
        { title: "Nombre", value: "nameClient" },
        { title: "Email", value: "email" },
        { title: "Email 2", value: "emailTwo" },
        { title: "Telefono", value: "phone" },
        { title: "Celular", value: "celphone" },
        { title: "Contacto", value: "contact" },
        { title: "Ciudad", value: "city" },
        { title: "Direccin", value: "adress" },
      ];
      let header = [
        { text: "PREMIOS INDIA CATALINA 2025", bold: true, size: 16 },
        `IMPRESION INFORME DE CANALES POR PAGAR`,
        `Fecha de impresin ${moment().format("YYYY-MM-DD")}`,
        ` `,
      ];
      if (RES.data.data.length) {
        const array_new = RES.data.data.channelForOrders;
        array_new.forEach((e) => {
          e.orders.forEach((i) => {
            this.array_usuarios.push({ ...i, ...e.channel });
          });
        });
      }
      this.array_usuarios = this.array_usuarios.filter(
        (e) => e.stateOrderId != 1
      );
      generarImpresion({
        header,
        logo: this.logo,
        tabla: { columnas, data: this.array_usuarios },
      });
      this.array_usuarios = [];
    },
    async cargarEstadoVotacion() {
      try {
        const response = await this._consultResultadoVotos();
        let columnas = [
          { title: "ID Categoria", value: "categoryId" },
          { title: "ID Postulacin", value: "postulationId" },
          { title: "Categoria", value: "categoryName" },
          { title: "Postulacin", value: "postulationName" },
          { title: "# evaluadores", value: "evaluatorsCompleted" },
          { title: "Programa", value: "programName" },
          {
            title: "Promedio votos evaluadores",
            value: "resultEvaluators",
            tipo: "number",
          },
          {
            title: "Promedio votos publico general",
            value: "resultPublic",
            tipo: "number",
          },
        ];
        let header = [
          { text: "PREMIOS INDIA CATALINA 2025", bold: true, size: 16 },
          `IMPRESIN INFORME ESTADO DE VOTACIONES`,
          `Fecha de impresin ${moment().format("YYYY-MM-DD")}`,
          ` `,
        ];
        await generarImpresion({
          header,
          logo: this.logo,
          tabla: { columnas, data: response },
        });
        this.callAlerta(
          "",
          "success",
          null,
          this.ALTD_,
          this.ALTD_,
          "Impresin generada correctamente"
        );
      } catch (error) {
        this.callAlerta("", "info", error, this.ALTD_, this.ALTD_, error);
      }
    },
    async cargarResultadoVotaciones() {
      try {
        const response = await this._consultResultadoVotosV2();
        let columnas = [
          { title: "Nombre", value: "nombre" },
          { title: "Apellido", value: "apellido" },
          { title: "Email", value: "email" },
          { title: "Telefono", value: "telefono" },
          { title: "Categoria", value: "categoria" },
          { title: "Talento", value: "talento" },
          { title: "Produccin", value: "produccion" },
          { title: "Criterio", value: "criterio" },
          { title: "Calificacin", value: "calificacion", tipo: "number" },
        ];
        let header = [
          { text: "PREMIOS INDIA CATALINA 2025", bold: true, size: 16 },
          `IMPRESIN INFORME ESTADO DE VOTACIONES`,
          `Fecha de impresin ${moment().format("YYYY-MM-DD")}`,
          ` `,
        ];
        await generarImpresion({
          header,
          logo: this.logo,
          tabla: { columnas, data: response },
        });
        this.callAlerta(
          "",
          "success",
          null,
          this.ALTD_,
          this.ALTD_,
          "Impresin generada correctamente"
        );
      } catch (error) {
        this.callAlerta("", "info", error, this.ALTD_, this.ALTD_, error);
      }
    },
    async cargarEstadoMiembros() {
      try {
        const response = await this._consultResultadoVotosV2();
        let columnas = [
          { title: "Nombre", value: "nombre" },
          { title: "Apellido", value: "apellido" },
          { title: "Email", value: "email" },
          { title: "Telefono", value: "telefono" },
          { title: "Categoria", value: "categoria" },
          { title: "Talento", value: "talento" },
          { title: "Produccin", value: "produccion" },
          { title: "Criterio", value: "criterio" },
          { title: "Calificacin", value: "calificacion", tipo: "number" },
        ];
        let header = [
          { text: "PREMIOS INDIA CATALINA 2025", bold: true, size: 16 },
          `IMPRESIN INFORME ESTADO DE VOTACIONES`,
          `Fecha de impresin ${moment().format("YYYY-MM-DD")}`,
          ` `,
        ];
        await generarImpresion({
          header,
          logo: this.logo,
          tabla: { columnas, data: response },
        });
        this.callAlerta(
          "",
          "success",
          null,
          this.ALTD_,
          this.ALTD_,
          "Impresin generada correctamente"
        );
      } catch (error) {
        this.callAlerta("", "info", error, this.ALTD_, this.ALTD_, error);
      }
    },
    async reportVoter() {
      try {
        const response = await this._reportVoter();
        let columnas = [
          { title: "Nombre", value: "nombre" },
          { title: "Apellido", value: "apellido" },
          { title: "Email", value: "email" },
          { title: "Telefono", value: "telefono" },
          { title: "Categoria", value: "categoria" },
          { title: "Talento", value: "talento" },
          { title: "Produccin", value: "produccion" },
          { title: "Criterio", value: "criterio" },
          { title: "Calificacin", value: "calificacion", tipo: "number" },
        ];
        let header = [
          { text: "PREMIOS INDIA CATALINA 2025", bold: true, size: 16 },
          `IMPRESIN INFORME ESTADO DE VOTACIONES`,
          `Fecha de impresin ${moment().format("YYYY-MM-DD")}`,
          ` `,
        ];
        await generarImpresion({
          header,
          logo: this.logo,
          tabla: { columnas, data: response },
        });
        this.callAlerta(
          "",
          "success",
          null,
          this.ALTD_,
          this.ALTD_,
          "Impresin generada correctamente"
        );
      } catch (error) {
        this.callAlerta("", "info", error, this.ALTD_, this.ALTD_, error);
      }
    },
    async cargarVotacionMiembrosVotantes() {
      try {
        const response = await this._getMiembroVotantes();

        let columnas = [
          { title: "Nombre", value: "name" },
          { title: "Apellido", value: "lastName" },
          { title: "Email", value: "email" },
          { title: "Documento", value: "document" },
          { title: "Celular", value: "celPhone" },
          { title: "Ocupacion", value: "occupation" },
          { title: "Posicion", value: "position" },
          { title: "Canal", value: "channel" },
        ];
        let header = [
          { text: "PREMIOS INDIA CATALINA 2025", bold: true, size: 16 },
          `IMPRESION INFORME DE MIEMBROS VOTANTES`,
          `Fecha de impresin ${moment().format("YYYY-MM-DD")}`,
          ` `,
        ];
        await generarImpresion({
          header,
          logo: this.logo,
          tabla: { columnas, data: response },
        });
      } catch (error) {
        this.callAlerta("", "info", error, this.ALTD_, this.ALTD_, error);
      }
    },
  },
};
</script>

